svg.script:
webMI.trigger.connect(
	"clicked",
	function(e) {
		webMI.display.openWindow({
			display: "SYSTEM.LIBRARY.PROJECT.OBJECTDISPLAYS.UPLOAD.Popup",
			extern: false,
			height: 240,
			width: 540,
			menubar: false,
			modal: false,
			movable: true,
			resizable: false,
			scrollbars: false,
			status: false,
			title: "PDF Upload",
			toolbar: false,
			query: webMI.query
		});
	},
	"upload_btn"
);
